import axios from "axios";

const API_URL = "http://localhost:8080/api/posts";

export interface Post {
    post_id? : number;
    goal_id : number;
    user_id : number;
    message_text : string;
    photo : Blob
};

export const sendMessage = async (post: Post) => {
    await axios.post(API_URL, post, {
        headers: {"Content-Type": "multipart/form-data"}
    })
}
